Disk Region: ALL Regions




Karaoke romance, frisky farm boys, vengeful mums, macho Mexicans and a magical Powerpoint presentation are just some of the refreshing and captivating themes that run through this second volume of nine gay shorts on the acclaimed Boys on Film label. Sexual tension becomes terrifying and bizarre in both Till Kleinert's award-winning Cowboy and Australian fang-fest Love Bites, while film festival favourites, the drop-dead sexy Bramadero and uplifting Futures &amp; Derivatives supply ample food for thought for fans of art-house cinema. Sweaty hook-ups abound in saucy gym tale Working It Out' while schoolboy crushes are at the fore in the heart-warming Lucky Blue. Once more, Boys On Film brings you an eclectic array of gay short films from around the world, each with a distinct flavour all its own. 


